import React from "react";
import HeaderBar from "./components/HeaderBar";
import Footer from "./components/Footer";
import { Outlet } from "react-router-dom";

export default function Root() {
    return (
        <>
            <HeaderBar/>
            <body>
                <Outlet/>
            </body>
            <Footer/>
        </>
    )
}
